// App.js
import { Routes, Route, BrowserRouter } from 'react-router-dom';
import Map from './Map';
import Preferences from './Preferences';

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path="/" element={<Map />} />
      <Route path="/preferences" element={<Preferences />} /> {}
      <Route path="/map" element={<Map />} />
    </Routes>
    </BrowserRouter>
  );
}

export default App;
